from sympy import isprime
def aupto(n):
    alst, used = [0, 1], {1}
    for k in range(2, n+1):
        ball = (str(alst[k-1]))[-1]
        ak = 1
        ball_left = ball + (str(ak))[:-1]
        while not isprime(int(ball_left)) or ak in used or isprime(ak):
            ak += 1 + (ak%10 == 9)  # can't end in 0
            ball_left = ball + (str(ak))[:-1]
        alst.append(ak)
        used.add(ak)
    return alst[1:]  # use alst[n] for a(n) function
